import axios from "axios";

export default class LibraryService {

    _urlBase = "http://localhost:8080/";

    getAllGenres  = async () => {
        let genres = [];

        await axios.get("http://localhost:8080/genres")
            .then(response => {
                if(response.data != null) {
                    genres = response.data;
                }
            });
        
        return genres;
    };

}
